import React, {useState, useEffect, useContext} from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import SubjectCard from '../components/SubjectCard';

import { AppContext } from '../AppContext';
import InterestsCard from '../components/InterestsCard';

function Recommendations() {  
    
    const data = useContext(AppContext);
    const [results, setResults] = useState({});

    useEffect(() => {
        setResults(data)
    }, [data]);

    const findRecommendations = (recommendations) => { 
        
        fetch('/api/recommendation', {
            method: 'POST',
            body: JSON.stringify({
                "student": {
                    "interests": ["Programming", "Maths", "Economics"]
                }
            }),
            headers: {
                'Content-Type': 'application/json',
            },
        })
        .then(async (res) => {
            console.log(res);
        })
        .catch((err) => {
            console.log(err)
        });
    }

    return (
        <>
            <CssBaseline />
            <Container maxWidth={false}>
                <Grid container spacing={3}>
                    <Grid item xs={8}>
                        <Typography variant='h5'> Course Recommendations </Typography>
                    </Grid>
                </Grid>
                <InterestsCard></InterestsCard>
                <br />
                {Object.keys(results).slice(0, 5).map((subject, key) => (
                    <SubjectCard key={key} subject={results[subject]} />
                ))}
            </Container>
        </>
    );
}

export default Recommendations;
